import mysql from 'mysql2/promise';

const dbConfig = {
  host: process.env.DB_HOST || 'localhost',
  user: process.env.DB_USER,
  password: process.env.DB_PASSWORD,
  database: process.env.DB_NAME,
};

export default async function handler(req, res) {
  if (req.method !== 'GET') {
    return res.status(405).json({ error: 'Method not allowed' });
  }

  const { id, search, role } = req.query;

  let connection;
  try {
    connection = await mysql.createConnection(dbConfig);

    // UNSICHER - SQL-Injection durch String-Konkatenation:
    // const query = `SELECT * FROM users WHERE id = ${id} AND name LIKE '%${search}%'`;
    // const [rows] = await connection.execute(query);

    // SICHER - Parametrisierte Queries mit Platzhaltern:
    let query = 'SELECT * FROM users WHERE 1=1';
    const params = [];

    if (id) {
      // Validierung als zusaetzliche Sicherheitsschicht
      const numericId = parseInt(id, 10);
      if (isNaN(numericId)) {
        return res.status(400).json({ error: 'Invalid ID format' });
      }
      query += ' AND id = ?';
      params.push(numericId);
    }

    if (search) {
      // Bei LIKE-Queries Wildcards in den Parameter verschieben
      query += ' AND name LIKE ?';
      params.push(`%${search}%`);
    }

    if (role) {
      query += ' AND role = ?';
      params.push(role);
    }

    // execute() mit Parametern verhindert SQL-Injection
    const [rows] = await connection.execute(query, params);

    return res.status(200).json({ users: rows });
  } catch (error) {
    // Fehler nicht an Client weitergeben (Information Disclosure)
    console.error('Database error:', error);
    return res.status(500).json({ error: 'Internal server error' });
  } finally {
    if (connection) {
      await connection.end();
    }
  }
}
